window.bookSummaryJSON = "<p><b>Billionaire playboy or the devil? A fallen angel can be both.</b></p> <p>Not only is Dominick Vicario tall, dark, and wickedly attractive, he’s also the head of the world’s most powerful underworld family. And the leader of the Fallen—former heavenly Watchers banished to Earth who’ve become wealthy playboys.</p> <p>When I meet him, my life is circling the drain. My job is going nowhere, my boyfriend is a jerk, and I’m in debt up to my eyeballs. </p> <p>So, when the dangerously seductive mafia don offers me a deal that will solve all my problems, I take it. All I have to do is spend the rest of the summer with the mysterious billionaire. A couple of months of jet-setting on private planes and yachts isn’t too high a price to pay, right?</p> <p>But Dominick believes I’m destined to be his mate—and the key to all the fallen angels being restored to their rightful place in the celestial order.</p> <p>And it doesn’t matter if I think he’s crazy. He’s convinced I’m his for eternity. And so are the demons chasing us.</p> <p>Can I escape from his immortal curse? Or will his dark past come back to haunt us both?</p> <p><b>Beware the cliff!</b></p> <p><b><i>Mark of the Fallen </i></b><b>is a devilishly steamy, fated mates paranormal romance with a mafia twist. This is book one in the Dark Fallen Angels trilogy, it’s a full-length novel, and it ends on a cliff-hanger. Consider yourself warned!</b></p>"; 
